sprites.onOverlap(SpriteKind.Enemy, SpriteKind.Updator, function (sprite, otherSprite) {
    if (sprites.readDataString(sprite, "Enemy") != "Bullet" || sprites.readDataString(sprite, "Enemy") != "Pirahna") {
        if (!(sprites.readDataBoolean(sprite, "Uptaded"))) {
            sprite.setVelocity(sprites.readDataNumber(sprite, "VX"), sprites.readDataNumber(sprite, "VY"))
            sprites.setDataBoolean(sprite, "Uptaded", true)
        }
    }
})
function new_effect (animation2: any[], intervals: number, VX: number, VY: number, Gravity: boolean, lifespan: number, location: string, who: Sprite, zdepth: boolean) {
    new_effect_sprite = sprites.create(img`
        3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 
        3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 
        3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 
        3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 
        3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 
        3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 
        3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 
        3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 
        3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 
        3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 
        3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 
        3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 
        3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 
        3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 
        3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 
        3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 3 
        `, SpriteKind.Effect)
    if (location == "Up") {
        tiles.placeOnTile(new_effect_sprite, tiles.getTileLocation(tiles.locationXY(tiles.locationOfSprite(who), tiles.XY.column), tiles.locationXY(tiles.locationOfSprite(who), tiles.XY.row) - 1))
    } else if (location == "Down") {
        tiles.placeOnTile(new_effect_sprite, tiles.getTileLocation(tiles.locationXY(tiles.locationOfSprite(who), tiles.XY.column), tiles.locationXY(tiles.locationOfSprite(who), tiles.XY.row) + 1))
    } else if (location == "Left") {
        tiles.placeOnTile(new_effect_sprite, tiles.getTileLocation(tiles.locationXY(tiles.locationOfSprite(who), tiles.XY.column) - 1, tiles.locationXY(tiles.locationOfSprite(who), tiles.XY.row)))
    } else if (location == "Right") {
        tiles.placeOnTile(new_effect_sprite, tiles.getTileLocation(tiles.locationXY(tiles.locationOfSprite(who), tiles.XY.column) + 1, tiles.locationXY(tiles.locationOfSprite(who), tiles.XY.row)))
    } else {
        tiles.placeOnTile(new_effect_sprite, tiles.getTileLocation(tiles.locationXY(tiles.locationOfSprite(who), tiles.XY.column), tiles.locationXY(tiles.locationOfSprite(who), tiles.XY.row)))
    }
    new_effect_sprite.setVelocity(VX, VY)
    new_effect_sprite.setFlag(SpriteFlag.Ghost, true)
    animation.runImageAnimation(
    new_effect_sprite,
    animation2,
    intervals,
    true
    )
    if (zdepth) {
        new_effect_sprite.z = -10
    }
    new_effect_sprite.lifespan = lifespan
    if (Gravity) {
        new_effect_sprite.ay = 800
    }
    timer.after(100, function () {
        new_effect_sprite.z = 10
    })
}
